import React, { useState,useEffect } from "react";
import "./Content.css";
// import Button from "react-bootstrap/Button";
import Card from "react-bootstrap/Card";
import { Avatar } from "@mui/material";

export default function Content() {
  let [Data, SetData] = useState([]);

  function Fun() {
    // fetch(
    //   `https://www.googleapis.com/youtube/v3/search?&part=snippet&maxResults=50&key=AIzaSyDHM9NhBsTWOyz-x41GNQ8jmcSiRVNAPYg&type=video`
    // )
    fetch(
             `https://www.googleapis.com/youtube/v3/search?&q=Shree+Ram&part=snippet&maxResults=50&key=AIzaSyDHM9NhBsTWOyz-x41GNQ8jmcSiRVNAPYg&type=video`
           )
      .then((Response) => {
        return Response.json();
      })
      .then((Data) => {
       
        SetData(Data.items);
      });
  }

  useEffect(()=>
  {
    Fun();
  },[])

  return (
    <div id="Content">
      <center>
        {Data.map((e) => (
          <Card style={{ width: "18rem" }}>
            <Card.Img variant="top" src={e.snippet.thumbnails.high.url} />
            <Card.Body>
              <div id="VData">
                <Avatar>A</Avatar>
                <Card.Title id="Title">{e.snippet.title}</Card.Title>
                <Card.Text>{e.snippet.channelName}</Card.Text>
              </div>
              <Card.Text>{e.snippet.channelTitle}</Card.Text>
            </Card.Body>
          </Card>
        ))}

        <hr />
      
      </center>
    </div>
  );
}
